import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import ToggleButton from 'react-bootstrap/ToggleButton';
import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';
import CardColumns from 'react-bootstrap/CardColumns';
import { Link } from 'react';


export default class Portfolio extends Component {
  render() {
    return (
      <div>
        <section className="portfolio-section" data-section="portfolio">
                      <h2 className="main-h2">Projects</h2>
            <div className="row card-wrapper">
            <Link to="https://www.hindawi.com/post/artificial-intelligence-manuscript-preparation/">
              <div className="col-md-12">
                <Card style={{ width: '33%' }}>
                  <Card.Img className="card-img" variant="top" width="100%" src="https://static-01.hindawi.com/styles/hindawi_wide/s3/2020-10/AI-in-Manuscripts_blog (1).jpg" />
                    <Card.Body>
                    <Card.Title>Artificial intelligence in manuscript preparation</Card.Title>
                    <Card.Text>
                      <p>How can publishers and authors benefit from AI and machine learning? Kurt Spurlock and I speculate about the near future.</p>
                      <p>Read more...</p>
                      </Card.Text>
                  </Card.Body>
                </Card>
              </div>
              </Link>
            </div>
        </section>
      </div>
    )
  }
}
